"use client";

import React from "react";
import { useNavigate } from "react-router-dom";

const NotFoundPage = () => {
  const navigate = useNavigate();

  const handleBackToHome = () => {
    navigate("/"); // Navigate to the homepage
  };

  return (
    <div
      className="bg-gray-50 min-h-screen flex flex-col items-center justify-center relative"
      style={{
        backgroundImage: `url(${require("../assets/storysetimages/404Error.svg").default})`,
        backgroundSize: "contain",
        backgroundRepeat: "no-repeat",
        backgroundPosition: "center",
      }}
    >
      {/* Back to Homepage Button */}
      <button
        onClick={handleBackToHome}
        className="absolute top-6 left-6 bg-teal-500 text-white px-4 py-2 rounded-full shadow-md hover:bg-teal-600 transition-all"
      >
        Back to Homepage
      </button>

      {/* Content Section */}
      <div className="text-center bg-white bg-opacity-80 p-8 rounded-lg shadow-lg max-w-lg animate__animated animate__fadeInDown">
        <h1 className="text-8xl font-extrabold text-teal-600 mb-4 drop-shadow-md">
          404
        </h1>
        <p className="text-2xl font-bold text-gray-700 mb-4">
          Page Not Found
        </p>
        <p className="text-gray-600 mb-6">
          It looks like you've stumbled upon a page that doesn't exist. Don't
          worry; let's guide you back to safety.
        </p>
        <button
          onClick={handleBackToHome}
          className="bg-teal-500 text-white px-6 py-3 rounded-full shadow-md hover:bg-teal-600 transition-all"
        >
          Take Me Home
        </button>
      </div>
    </div>
  );
};

export default NotFoundPage;
